import React from "react";
import { Modal, Space } from 'antd';


class CustomModal extends React.Component(props) {

  render() {
    return (
        <Modal
          title="Associate Software Engineer @ DXC Technology"
          visible={props.isModalOpen}
          onOk={() => {}}
          onCancel={() => {}}
        >
          I join Fresher Program at DXC in 9/2017 and passed. After that I join to the MISR team, an insurance outsourcing for an Egypt client. I work as front-end developer in MISR to 05/2018, then I change to mobility team in 1 month, after that I back to the web team and work as full stack developer.
        </Modal>
    );
  }
}

export default CustomModal;
